import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

const PortfolioSection = () => {
  const [selectedCar, setSelectedCar] = useState(0);

  const portfolioItems = [
    {
      car: 'Tesla Model S',
      image: 'https://source.unsplash.com/random/800x600?tesla',
      stats: [
        { label: 'Interior', value: 'Platinum' },
        { label: 'Exterior', value: 'Gold' },
        { label: 'Duration', value: '5 hrs' },
        { label: 'Satisfaction', value: '100%' },
      ],
      workImages: [
        { src: 'https://source.unsplash.com/random/300x200?car+interior', alt: 'Interior detailing' },
        { src: 'https://source.unsplash.com/random/300x200?car+exterior', alt: 'Exterior polishing' },
        { src: 'https://source.unsplash.com/random/300x200?car+wheel', alt: 'Wheel cleaning' },
      ],
    },
    {
      car: 'BMW M3',
      image: 'https://source.unsplash.com/random/800x600?bmw',
      stats: [
        { label: 'Interior', value: 'Gold' },
        { label: 'Exterior', value: 'Platinum' },
        { label: 'Duration', value: '6 hrs' },
        { label: 'Satisfaction', value: '100%' },
      ],
      workImages: [
        { src: 'https://source.unsplash.com/random/300x200?bmw+interior', alt: 'Interior detailing' },
        { src: 'https://source.unsplash.com/random/300x200?bmw+exterior', alt: 'Exterior polishing' },
        { src: 'https://source.unsplash.com/random/300x200?bmw+wheel', alt: 'Wheel cleaning' },
      ],
    },
    {
      car: 'Audi RS6',
      image: 'https://source.unsplash.com/random/800x600?audi',
      stats: [
        { label: 'Interior', value: 'Silver' },
        { label: 'Exterior', value: 'Platinum' },
        { label: 'Duration', value: '7 hrs' },
        { label: 'Satisfaction', value: '100%' },
      ],
      workImages: [
        { src: 'https://source.unsplash.com/random/300x200?audi+interior', alt: 'Interior detailing' },
        { src: 'https://source.unsplash.com/random/300x200?audi+exterior', alt: 'Exterior polishing' },
        { src: 'https://source.unsplash.com/random/300x200?audi+wheel', alt: 'Wheel cleaning' },
      ],
    },
  ];

  return (
    <div className="flex flex-col h-screen bg-black text-white p-8">
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        className="mb-8"
      >
        <span className="text-6xl font-bold text-gray-800">03</span>
      </motion.div>
      <motion.h2
        initial={{ opacity: 0, y: 50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.2 }}
        className="text-5xl font-bold mb-12"
      >
        Our Portfolio.
      </motion.h2>

      <div className="flex justify-between items-center mb-8">
        <motion.h3 
          className="text-4xl font-bold"
          key={selectedCar}
          initial={{ opacity: 0, x: -50 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.5 }}
        >
          {portfolioItems[selectedCar].car}
        </motion.h3>
        <motion.button 
          className="px-4 py-2 bg-blue-500 rounded-full text-sm"
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
        >
          View Details
        </motion.button>
      </div>

      <div className="flex justify-between mb-12">
        <div className="w-1/4">
          {portfolioItems.map((item, index) => (
            <motion.div
              key={index}
              className={`cursor-pointer mb-4 ${selectedCar === index ? 'text-blue-500' : 'text-gray-500'}`}
              onClick={() => setSelectedCar(index)}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              {item.car}
            </motion.div>
          ))}
        </div>
        <div className="w-1/2 relative h-80">
          <AnimatePresence mode="wait">
            <motion.img
              key={selectedCar}
              src={portfolioItems[selectedCar].image}
              alt={portfolioItems[selectedCar].car}
              className="w-full h-full object-cover absolute"
              initial={{ opacity: 0, scale: 0.8 }}
              animate={{ opacity: 1, scale: 1 }}
              exit={{ opacity: 0, scale: 0.8 }}
              transition={{ duration: 0.5 }}
            />
          </AnimatePresence>
        </div>
        <div className="w-1/4">
          {portfolioItems[selectedCar].stats.map((stat, index) => (
            <motion.div 
              key={index} 
              className="mb-4"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <div className="text-sm text-gray-500">{stat.label}</div>
              <div className="text-2xl font-bold">{stat.value}</div>
            </motion.div>
          ))}
        </div>
      </div>

      <div className="grid grid-cols-3 gap-4">
        {portfolioItems[selectedCar].workImages.map((img, index) => (
          <motion.div
            key={index}
            initial={{ opacity: 0, scale: 0.8 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.5, delay: index * 0.1 }}
          >
            <motion.img
              src={img.src}
              alt={img.alt}
              className="w-full h-32 object-cover rounded"
              whileHover={{ scale: 1.05 }}
            />
          </motion.div>
        ))}
      </div>
    </div>
  );
};

export default PortfolioSection;
